ly: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">【盛田农业芥丝简介】</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 嵩山芥丝选用盛田农业合作社在嵩山脚下的有机种植基地生产的优质原叶芥菜，因嵩山特殊的气候和农家特殊的腌制方法，运用传统&nbsp;工艺精致而成的沁人心肺，清爽可口而远近闻名。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">&nbsp; &nbsp; &nbsp; &nbsp; 唐太宗李世民避难少林寺时及唐朝武则天游封嵩山时都曾经信用，且赞叹不已。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">&nbsp; &nbsp; &nbsp; &nbsp; 芥菜俗名【芥疙瘩】，芥菜能开胃，李时珍本草纲目云：【芥菜利膈开胃】，凡是胃部消化能力薄弱，可用芥菜作为食疗。芥菜含有碳水化合物、钙、磷、维生素C等。芥菜含防癌物质维生素A原，食之可补充人体维生素A。性味辛温，归肺、脾、胃经。具有利尿止泻，祛风散血，消肿止痛的作用。主治小便不利、腹泻、痢疾、咳血、牙龈肿痛、喉痛声哑、痔疮肿痛、跌打损伤等病症，是民间常用的草药。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">&nbsp; &nbsp; &nbsp; &nbsp; 本产品内含粗蛋白，游离态氨基酸、维生素C、核黄素、胡萝卜素及磷、钙、铁等矿物质。</span></span></p>\r\n<hr style=\"padding: 0px; margin: 0px; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: norm