al; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><strong style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: x-large;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">传世贡茶</span></span></strong></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: large;\">HANDED DOWN TRIBUTE</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; &ldquo;禹密二花（金银花）&rdquo;是我国著名的药用花卉，是国家管理的38种名贵中药材之一。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 自明清开始，&ldquo;禹密二花&rdquo;每年朝贡朝廷，成国御用贡品。清慈禧太后，把产于禹州的&ldquo;禹密二花&rdquo;视为延年益寿的宫廷珍品，每天必饮一杯。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">&nbsp; &nbsp; &nbsp; &nbsp; 毛泽东主席生前爱饮金银花茶，多次对人讲：&ldquo;金银花、胖大海，这两样中药对人的嗓子很有好处&rdquo;。</span></span></p>\r\n<hr style=\"padding: 0px; margin: 0px; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\" />\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><strong style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: x-large;\">抗菌素之王&mdash;&mdash;禹密二花</span></strong></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 明《本草纲目》载：&ldquo;金银花产于禹州五指岭下&rdquo;，禹州五指岭的金银花于1914年在巴拿马万国博览会上展出，受到世界医药界的欢迎，是中国传统名贵药材。《中国道地药材》把河南禹州作为金银花的道地产区，称&ldquo;禹密二花&rdquo;。其体肥，色微黄，有芳香，放在碗中用开水一冲，头朝下，整齐而美观，药效也高。</span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 禹密二花药用历史有史可查在3000年以上，是中国春夏家庭常备的预防流行性疾病人传统中药。中国中医早已证实，金银花具有清热解毒之功能，有&ldquo;抗菌素之王&rdquo;的美称。中医认为，金银花性寒、味甘，有疏散风热、清热解毒之功，因此，临床上常用于呼吸道感染、流行性感冒、扁桃体炎、急性乳腺炎、大叶性肺炎、细菌性疾病的等症的治疗。著名古方银翘散及银翘散的改良剂银翘丸便是以金银花为主药，是用于治疗感冒、咽喉炎、口腔和皮肤病的著名中成药。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 禹州自古即是中国著名中药材市场，&ldquo;禹密二花&rdquo;作为道地中药材，中外驰名，历史悠久，出口多个国家和地区。当地人把金银花视为珍宝，更把&ldquo;禹密二花&rdquo;作为礼品馈赠亲友，俗称&ldquo;送金银送健康，姐妹二花兆吉祥&rdquo;。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>', '1211', '积分商品', '盛田农业', '0', '', '', '1', '1', null, '1462500267', '1462500267', '264', 'data/files/store_772/goods_45/small_201605061804057098.jpg', '1', '1211', '0', '0', '0', '298.00', '', '0', '', '0', '0', '1', '100', '1', '0.00', '5.00', 'weight');
