g: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\" />\r\n<p class=\"p0\" style=\"padding: 0px; margin: 0pt 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><strong style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">【主要成分】</span></span></strong></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 1. 蛋白质，脂肪，维生素，钙，磷，铁等，这些都是人体不可缺少的营养成分；</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 2. 酱豆富含优质蛋白质，烹饪时不仅能增加菜品的营养价值，而且蛋白质在微生物的作用下生成氨基酸，可使菜品呈现出更加鲜美的滋味，有开胃助食的功效；</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 3. 酱豆中还富含亚油酸，亚麻酸，对人体补充必须脂肪酸和降低胆固醇均有益处，从而降低患心血管疾病的几率；</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 4. 酱豆中的脂肪富含不饱和脂肪酸和大豆磷脂，邮宝持血管弹性，健脑和防止脂肪形成的作用。</span></span></p>\r\n<p style=\"text-align: center;\"><img src=\"http://s.hnsjb.cn//data/files/store_772/goods_103/201605061811438709.jpg\" alt=\"4.jpg\" /></p>', '1211', '积分商品', '盛田农业', '0', '', '', '1', '1', null, '1462500816', '1462500816', '265', 'data/files/store_772/goods_8/small_201605061813282185.jpg', '1', '1211', '0', '0', '0', '39.00', '', '0', '', '0', '0', '1', '100', '1', '