INSERT INTO `ecm_goods` VALUES ('276', '772', 'material', '禹州粉皮', '<p><span style=\"padding: 0px; margin: 0px; border: none; color: #339966; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; font-size: 12pt; font-family: 宋体; background-color: #f4f4f4;\"><span class=\"Apple-converted-space\">&nbsp;</span>禹县纯红薯手工粉</span><span style=\"padding: 0px; margin: 0px; border: none; color: #339966; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; font-size: 12pt; font-family: 宋体; background-color: #f4f4f4;\">皮</span><span style=\"padding: 0px; margin: 0px; border: none; color: #339966; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; font-size: 12pt; font-family: 宋体; background-color: #f4f4f4;\">，产于禹州市北部山岗区，历史悠久，已在近600年的生产历史。产品以盛田农业有机红薯种植基地的精制红薯淀粉为原料，采用独特传统手工工艺精细加工而成。其特点是：易烹饪，耐保存，晶莹剔透、弹性强、条杆均匀、口感滑爽、久煮不糊，深受人们喜爱。属于低脂肪、低糖纯绿色天然食。是馈赠亲朋好友之佳品。</span></p>\r\n<p style=\"text-align: center;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; font-size: 12pt; font-family: 宋体; background-color: #f4f4f4;\"><img src=\"http://s.hnsjb.cn//data/files/store_772/goods_