INSERT INTO `ecm_goods` VALUES ('294', '772', 'material', '黑豆腐竹', '<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-family: 宋体; color: #339966; font-size: medium;\"><span class=\"Apple-converted-space\">&nbsp;</span>许昌腐竹、豆油皮产自&ldquo;中国腐竹之乡&rdquo;河街，有百年加工历史，以口感滑嫩、味道醇香而倍负盛名。许昌腐竹、豆油皮制作工艺沿袭传统手法，使许昌腐竹、豆油皮成为集营养于一体的食品。许昌腐竹、豆油皮因其营养价值高，且口味鲜美，逐渐成为人们喜爱的一道美食。</span></p>\r\n<p><br class=\"Apple-interchange-newline\" /><img style=\"margin-right: auto; margin-left: auto; display: block;\" src=\"http://s.hnsjb.cn//data/files/store_772/goods_6/201605091020065681.jpg\" alt=\"44.jpg\" /></p>\r\n<p class=\"p0\" style=\"padding: 0px; margin: 0pt 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><strong style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">【豆的养生作用】</span></span></strong></p>\r\n<p class=\"p0\" style=\"padding: 0px; margin: 0pt 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 黑豆，性平，味甘。具有调中下气、滋阴补肾、补血明目、利水消肿、活血美肤等作用。&nbsp;</span></span></p>\r\n<p class=\"p0\" style=\"padding: 0px; margin: 0pt 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 黑豆的营养价值很高，黑豆中含有丰富的优质蛋白质和脂肪以及碳水化合物，此外，还含有较多的钙、磷、铁等矿物质和胡萝卜素以及多种维生素B1、B2、B12等人体所需的各种营养素。黑豆的营养成分与黄豆不相上下，而所含蛋白质却高于黄豆，是仅次于黄豆的豆类。</span></span></p>\r\n<p style=\"text-align: center;\"><img src=\"http://s.hnsjb.cn//data/files/store_772/goods_6/201605091020066132.jpg\" alt=\"55.jpg\" /></p>\r\n<p class=\"p0\" style=\"padding: 0px; margin: 0pt 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">黑</span></span><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium; color: #339966;\">豆可煮、可炒、可做豆腐、生豆芽，也可制成黑豆粉食用。</span></p>\r\n<p class=\"p0\" style=\"padding: 0px; margin: 0pt 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 常食黑豆，对病后体弱者有良好的滋补作用。&nbsp;黑豆入肾经，具有滋肾补肾、补血明目之功能。</span></span></p>\r\n<p class=\"p0\" style=\"padding: 0px; margin: 0pt 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 经常食用黑豆，对肾虚体弱、腰痛膝软、身面浮肿、风湿痹病、关节不利、痈肿疮毒等症有良好的防治作用。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 李时珍在《本草纲目》中说：&ldquo;久食黑豆，好颜色，变白不老。&rdquo;可见黑豆还有长肌肤、益颜色、健体延年之功效，久食能使肌细肤白。<br style=\"padding: 0px; margin: 0px;\" />&nbsp; &nbsp; &nbsp; &nbsp; 其实黑豆腐竹的营养价值要比黑豆高,腐竹是豆制品中营养价值比较高的豆制品。</span></span></p>\r\n<p style=\"text-align: center;\"><img src=\"http://s.hnsjb.cn//data/files/store_772/goods_7/201605091020077958.jpg\" alt=\"66.jpg\" /></p>\r\n<p class=\"p0\" style=\"padding: 0px; margin: 0pt 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-we