INSERT INTO `ecm_goods` VALUES ('311', '772', 'material', '九蒸九晒熟地', '<p style=\"text-align: center;\"><img src=\"http://s.hnsjb.cn//data/files/store_772/goods_114/201605091045142420.jpg\" alt=\"2.jpg\" /></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; 禹州<span style=\"padding: 0px; margin: 0px; border: none; background-color: #ff6600;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">九</span>蒸九晒熟地黄</span>以禹州道地地黄为原料，严格遵照禹州历史传统古蒸法九蒸九晒炮制工艺而成。2007年在年近八旬的国家级老药工，中药加工炮制技艺非物质文化遗产传承人朱青山先生数年试验研制基础上，在河南盛田农业合作社、禹州市药王孙思邈养生文化研究会、禹州市中药材办公室的共同努力下，终于得以恢复生产，并获国家专利。其品质真正达到了古法&ldquo;黑如漆、亮如油、甜如饴&rdquo;的炮制要旨。获得国内中医中药专家一致认可。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">&nbsp; &nbsp; &nbsp; &nbsp;<span class=\"Apple-converted-space\">&nbsp;</span><span style=\"padding: 0px; margin: 0px; border: none; background-color: #ff6600;\">九蒸九晒熟地黄</span>味甘如饴，补肝益肾，滋阴补血。熟地黄性质粘腻，有碍消化，禹州<span style=\"padding: 0px; margin: 0px; border: none; background-color: #ff6600;\">九蒸九晒熟地黄</span>加入了砂仁、黄酒、克服了普通熟地黄的腻性，有健胃消食功效，老少妇女健康人病人皆宜食用。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">&nbsp; &nbsp; &nbsp; &nbsp;<span class=\"Apple-converted-space\">&nbsp;</span><span style=\"padding: 0px; margin: 0px; border: none; color: #ff6600;\">九蒸九晒熟地黄</span>功效：熟地黄是中医常用药物，也是家庭常用的补益食品。中医认为大熟地有滋阴补血，益精填髓功效，主要用于肝肾阴虚，腰膝酸软，骨蒸潮热，盗汗遗精、内热消渴，血虚萎黄，心悸怔忡，月经不调，崩漏下血，眩晕，耳鸣，须发早白。民间多用<span style=\"padding: 0px; margin: 0px; border: none; color: #ff6600;\">熟地黄</span>益智、抗衰老、增强免疫力、抗辐射、滋阴、补血、排毒、养颜、轻身、明目、补肾、健胃消食、活血壮筋，治疗腰疼、糖尿病、焦虑症、更年期综合症、伤科、妇科、脱发、皮肤病等很多疾病。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">&nbsp; &nbsp; &nbsp; &nbsp; 《本经逢源》：<span style=\"padding: 0px; margin: 0px; border: none; background-color: #ff6600;\">熟地黄</span>，假火力蒸晒，转苦为甘，为阴中之阳，故能补肾中元气。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">&nbsp; &nbsp; &nbsp; &nbsp; 《本草正义》：能补养中土，为滋养之上品。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">&nbsp; &nbsp; &nbsp; &nbsp; 《神农本草经》：久服轻身不老，生者优良。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">&nbsp; &nbsp; &nbsp; &nbsp; 《医学启源》：虚损血衰之人须用，善黑须发。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">&nbsp; &nbsp; &nbsp; &nbsp; 《珍珠囊》：大补血虚不足，通血脉，益气力。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">&nbsp; &nbsp; &nbsp; &nbsp; 《本草汇言》：熟地稍温，其功更溥。久病阴伤，新产血败，在所必需者也。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">&nbsp; &nbsp; &nbsp; &nbsp; 《本草正》：<span style=\"padding: 0px; margin: 0px; border: none; background-color: #ff6600;\">熟地黄</span>性平，气味纯静，故能补五脏之真阴。</span></span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>', '1211', '积分商品', '盛田农业', '0', '', '', '1', '1', null, '1462733131', '1462733131', '310', 'data/files/store_772/goods_104/small_201605091045047817.jpg', '1', '1211', '0', '0', '0', '398.00', '', '0', '', '0', '0', '1', '100', '1', '0.00', '1.00', 'number');
