INSERT INTO `ecm_goods` VALUES ('313', '772', 'material', '禹州十全虫', '<p><img src=\"http://s.hnsjb.cn//data/files/store_772/goods_13/201605091046539074.jpg\" alt=\"5.jpg\" /></p>\r\n<p class=\"p0\" style=\"padding: 0px; margin: 0pt 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">十全虫是养生保健之佳品</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 药膳同源，禹州<strong style=\"padding: 0px; margin: 0px;\">十全虫</strong>（又名十腿蝎、会全蝎）既是名贵中药材又是名贵的滋补佳品。全蝎作为食用在我国有悠久历史，我国古代皇宫满汉全席的最后一道菜既是全蝎，蝎子开水焯水之后，经烘焙毒性大减，不但味美，更是一道保健佳肴，对预防半身不遂，食道癌，肝癌等疾病有很好的治疗和预防作用。<br style=\"padding: 0px; margin: 0px;\" /></span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">十全虫功效</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 蝎子以干燥虫体入药，称&ldquo;全蝎&rdquo;或&ldquo;全虫&rdquo;。远在《诗经》里早有记载，作为药用唐宋时即有全蝎入药记载，始见于《蜀本草》，距今已有1100多年的历史。</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 蝎子味辛，性平，有毒，入肝经，具有息风镇痉，攻毒散结，通络止痛之功效。《本草纲目》载全蝎&ldquo;祛风，止痉，通络，解毒。治惊风抽搐，癫痫，中风、半身不遂、口眼歪斜，偏头痛，风湿痹痛，破伤风，淋巴结结核，风疹疮肿。&rdquo;&ldquo;治大人痃疟，耳聋，疝气，诸风疮，女人带下，阴脱。&rdquo;《玉楸药解》记述全蝎&ldquo;穿筋透骨，逐湿除风。&rdquo;</span></span></p>\r\n<p><img src=\"http://s.hnsjb.cn//data/files/store_772/goods_13/201605091046538038.jpg\" alt=\"6.jpg\" /></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: x-large;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\">禹贡十全虫天下第一蝎</span></span></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><strong style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">传世贡品</span></span></strong><em style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">HANDED DOWN TRIBUTE</span></span></em></p>\r\n<p style=\"padding: 0px; margin: 0px; border: none; color: #666666; font-family: \'Microsoft YaHei\', SimSun, Arial; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #f4f4f4;\"><span style=\"padding: 0px; margin: 0px; border: none; color: #339966;\"><span style=\"padding: 0px; margin: 0px; border: none; font-size: medium;\">&nbsp; &nbsp; &nbsp; &nbsp; 中国传统医学上，全蝎以河南产的&ldquo;南全虫&rdquo;被奉为产地药材。特别是产于河南禹州、许昌等地的&ldquo;南全虫&rdquo;，因其质量上乘，仅能在&ldquo;四大药市&rdquo;的禹州中药材交易会上才能买到，民间谷称&ldquo;会全蝎&rdquo;，是&ldquo;南全虫&rdquo;中的上品。尤为值得一提的是，&ldquo;会全蝎&rdquo;中产与河南禹州狼（春）岗的&ldquo;十腿蝎&rdquo;，比其它地方的蝎子多出两条腿，被药商们俗称为十全虫，更是蝎子道地产区中之极品，北宋以来作为禹州官司供的上乘药材进贡朝廷，史称&rdquo;禹贡十全虫&ldquo;，誉为&rdquo;天下第一蝎&ldquo;，盛名中外。</span></span></p>\r\n<p><img src=\"http://s.hnsjb.cn//data/files/store_772/goods_13/201605091046539613.jpg\" alt=\"7.jpg\" /></p>', '1211', '积分商品', '盛田农业', '0', '', '', '1', '1', null, '1462733263', '1462733263', '312', 'data/files/store_772/goods_182/small_201605091046221268.jpg', '1', '1211', '0', '0', '0', '798.00', '', '0', '', '0', '0', '1', '100', '1', '0.00', '0.00', 'number');
