INSERT INTO `ecm_goods` VALUES ('352', '6285', 'material', '蜜乐 中锋蜂蜜1000g', '<p style=\"line-height: normal; color: #000000; font-size: medium;\"><img src=\"https://img.alicdn.com/imgextra/i4/1102809068/TB2gQeunXXXXXaKXXXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /></p>\r\n<p style=\"line-height: normal; color: #000000; font-size: medium;\"><span style=\"line-height: 27.0px; font-size: 18.0px;\">中华传统土蜂蜂蜜</span><span style=\"line-height: 1.5; font-size: 18.0px;\">又称土蜂蜜，就是中华蜂<span style=\"font-weight: bold;\">采集本土百花而成，产量稀缺，山区放养无污染</span>。相比传统蜂蜜效果更好。</span><span style=\"color: #404040; font-size: 18.0px; line-height: 25.0px;\">土蜂蜜含有丰富的蛋白质、氨基酸、维生素、微量元素和酶类、核酸、黄酮类等100多种营养物质，是</span><span style=\"color: #404040; font-size: 18.0px; line-height: 25.0px; font-weight: bold;\">浓缩的天然药库</span><span style=\"color: #404040; font-size: 18.0px; line-height: 25.0px;\">。</span></p>\r\n<p style=\"line-height: normal; color: #000000; font-size: medium;\"><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">我国的中华蜂在民间俗称为土蜂，只有这种蜂产的蜜才叫土蜂蜜。所采的蜜是山区高寒森林各种植物的野山花蜜，其蜜色泽深，结晶后为金黄色、口感清香而浓郁，富含有多种能被人体直接吸收的微量元素，由于酿蜜周期长、蜜源稀少被誉为</span><span style=\"font-weight: bold; line-height: 25.0px; color: #404040; font-size: 18.0px;\">&ldquo;蜜之珍品&rdquo;</span><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">。 据《本草纲目》中记载，正宗土蜂蜜是药引的不二之选，堪称</span><span style=\"font-weight: bold; line-height: 25.0px; color: #404040; font-size: 18.0px;\">&ldquo;蜜中精品&rdquo;</span><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">。</span></p>\r\n<p style=\"line-height: normal; color: #000000; font-size: medium;\"><img src=\"https://img.alicdn.com/imgextra/i3/1102809068/T2K_qXX4RXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i1/1102809068/T22Y8.X2XaXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i4/1102809068/T2561XX3JXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /></p>\r\n<p style=\"line-height: normal; color: #000000; font-size: medium;\" align=\"center\">&nbsp;</p>\r\n<p style=\"line-height: normal; color: #000000; font-size: medium;\">&nbsp;<img src=\"https://img.alicdn.com/imgextra/i3/1102809068/TB2Gq5hnXXXXXbYXXXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i4/1102809068/TB2k2hAnXXXXXc3XpXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><img style=\"text-align: center; float: none; margin: 0.0px; padding: 0.0px;\" src=\"https://img.alicdn.com/imgextra/i1/1102809068/T2ERC_XjRaXXXXXXXX_!!1102809068.jpg\" alt=\"\" /><a style=\"text-align: center; text-decoration: none; color: #3355aa; outline: none;\" href=\"http://milebjp.tmall.com/p/rd301457.htm?spm=a1z10.1.w5001-4723644935.2.Bn58k7&amp;scene=taobao_shop\" target=\"_blank\"><img src=\"https://img.alicdn.com/imgextra/i1/1102809068/TB2bQFqnXXXXXbFXXXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /></a><img style=\"text-align: center; float: none; margin: 0.0px; padding: 0.0px;\" src=\"https://img.alicdn.com/imgextra/i2/1102809068/T2Df_eXoxXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i2/1102809068/TB2Cg8BnXXXXXa0XXXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><a style=\"text-align: center; text-decoration: none; color: #3355aa; outline: none; line-height: 1.5;\" href=\"http://milebjp.tmall.com/search.htm?spm=a220o.1000855.w6-17816261433.6.BlOVND&amp;scid=657612541&amp;scname=1fK16ruxu6jD2w%3D%3D&amp;checkedRange=true&amp;queryType=cat\" target=\"_blank\"><img style=\"float: none; margin: 0.0px; padding: 0.0px;\" src=\"https://img.alicdn.com/imgextra/i4/1102809068/T2cSolXoFXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absMiddle\" /></a><a style=\"text-align: center; text-decoration: none; color: #3355aa; outline: none; line-height: 1.5;\" href=\"http://milebjp.tmall.com/\" target=\"_blank\"><img style=\"float: none; margin: 0.0px; padding: 0.0px;\" src=\"https://img.alicdn.com/imgextra/i2/1102809068/T2Jx0yXcpOXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /></a></p>', '1226', '食品	饮品', '蜜乐', '0', '', '', '1', '0', null, '1462825130', '1463078016', '351', 'data/files/store_6285/goods_197/small_201605131033178263.jpg', '1', '1216', '1226', '0', '0', '115.00', '', '0', '', '0', '0', '0', '0', '0', '0.00', '1.10', 'weight');
