INSERT INTO `ecm_goods` VALUES ('353', '6285', 'material', '蜜乐 鲜活槐花蜂蜜500g', '<p style=\"color: #000000; font-size: medium; line-height: normal; text-align: center;\"><img src=\"https://img.alicdn.com/imgextra/i4/1102809068/TB2jXCBnXXXXXXuXXXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal; text-align: left;\"><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">亲，你知道吗？槐花蜜是我国大宗蜜源量产的</span><strong style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">上等蜜品</strong><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">，也是历年</span><strong style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">大量出口、价位高的蜜品</strong><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">。</span></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal; text-align: left;\"><span style=\"text-align: center; line-height: 25.0px; color: #404040; font-size: 18.0px;\">蜜乐的槐花蜜长期出口欧美日韩等国，在韩国，蜜乐的槐花蜜是制作</span><strong style=\"text-align: center; line-height: 25.0px; color: #404040; font-size: 18.0px;\">蜂蜜柚子茶</strong><span style=\"text-align: center; line-height: 25.0px; color: #404040; font-size: 18.0px;\">的主要原料。</span><span style=\"text-align: center; line-height: 1.5; color: #404040; font-size: 18.0px;\">（喜欢DIY的朋友可以也可以尝试一下哦）</span></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal; text-align: left;\"><span style=\"text-align: center; line-height: 25.0px; color: #404040; font-size: 18.0px;\">槐花蜜具有清淡幽香的</span><strong style=\"text-align: center; line-height: 25.0px; color: #404040; font-size: 18.0px;\">槐花香味，甘甜鲜洁，芳香适口</strong><span style=\"text-align: center; line-height: 25.0px; color: #404040; font-size: 18.0px;\">。</span></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal; text-align: center;\"><img src=\"https://img.alicdn.com/imgextra/i4/1102809068/T2WBwkXiBaXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absMiddle\" /><img style=\"text-align: center;\" src=\"https://img.alicdn.com/imgextra/i1/1102809068/T2ERC_XjRaXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal; text-align: left;\"><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">中国槐花蜜产量占总产量10%左右，主产区以河南为中心，集中在黄河流域，尤其以</span><span style=\"line-height: 25.0px; color: #ff0000; font-size: 18.0px;\"><strong>河南豫西山区（蜜乐的蜜源地）</strong></span><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">、陕西延安地区、东北大连为主。</span><img src=\"https://img.alicdn.com/imgextra/i3/1102809068/T2fwxPXfpeXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absMiddle\" /><img src=\"https://img.alicdn.com/imgextra/i3/1102809068/T2dku7Xb0bXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absMiddle\" /><a href=\"http://milebjp.tmall.com/p/rd301457.htm?spm=a1z10.1.w5001-4723644935.2.Bn58k7&amp;scene=taobao_shop\" target=\"_blank\"><img src=\"https://img.alicdn.com/imgextra/i1/1102809068/TB2bQFqnXXXXXbFXXXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /></a></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal; text-align: center;\"><img src=\"https://img.alicdn.com/imgextra/i1/1102809068/T2KsZlXblaXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absMiddle\" /><img src=\"https://img.alicdn.com/imgextra/i3/1102809068/T27S3kXdXaXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absMiddle\" /><img src=\"https://img.alicdn.com/imgextra/i2/1102809068/T2Df_eXoxXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i2/1102809068/TB2Cg8BnXXXXXa0XXXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><a style=\"line-height: 1.5;\" href=\"http://milebjp.tmall.com/search.htm?spm=a220o.1000855.w6-17816261433.6.BlOVND&amp;scid=657612541&amp;scname=1fK16ruxu6jD2w%3D%3D&amp;checkedRange=true&amp;queryType=cat\" target=\"_blank\"><img src=\"https://img.alicdn.com