INSERT INTO `ecm_goods` VALUES ('364', '6285', 'material', '蜜乐 出口韩国槐花蜜1000g', '<p style=\"color: #000000; font-size: medium; line-height: normal; text-align: center;\"><img src=\"https://img.alicdn.com/imgextra/i3/1102809068/TB2IjOUnXXXXXX3XFXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal;\"><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">亲，你知道吗？槐花蜜是我国大宗蜜源量产的</span><strong style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">上等蜜品</strong><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">，也是历年</span><strong style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">大量出口、价位高的蜜品</strong><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">。</span></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal;\"><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">蜜乐的槐花蜜长期出口欧美日韩等国，在韩国，蜜乐的槐花蜜是制作</span><strong style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">蜂蜜柚子茶</strong><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">的主要原料。</span><span style=\"line-height: 1.5; color: #404040; font-size: 18.0px;\">（喜欢DIY的朋友可以也可以尝试一下哦）</span></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal;\"><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">槐花蜜具有清淡幽香的</span><strong style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">槐花香味，甘甜鲜洁，芳香适口</strong><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">。</span></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal; text-align: center;\"><img src=\"https://img.alicdn.com/imgextra/i4/1102809068/T2WBwkXiBaXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absMiddle\" /><img src=\"https://img.alicdn.com/imgextra/i1/1102809068/T2ERC_XjRaXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i3/1102809068/TB26AVfnXXXXXXyXpXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i3/1102809068/T2fwxPXfpeXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absMiddle\" /><img src=\"https://img.alicdn.com/imgextra/i3/1102809068/T2dku7Xb0bXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absMiddle\" /><a href=\"http://milebjp.tmall.com/p/rd301457.htm?spm=a1z10.1.w5001-4723644935.2.Bn58k7&amp;scene=taobao_shop\" target=\"_blank\"><img src=\"https://img.alicdn.com/imgextra/i1/1102809068/TB2bQFqnXXXXXbFXXXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /></a><img src=\"https://img.alicdn.com/imgextra/i1/1102809068/T2KsZlXblaXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absMiddle\" /><img src=\"https://img.alicdn.com/imgextra/i3/1102809068/T27S3kXdXaXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absMiddle\" /><img src=\"https://img.alicdn.com/imgextra/i2/1102809068/T2Df_eXoxXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i2/1102809068/TB2Cg8BnXXXXXa0XXXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><a style=\"line-height: 1.5;\" href=\"http://milebjp.tmall.com/search.htm?spm=a220o.1000855.w6-17816261433.6.BlOVND&amp;scid=657612541&amp;scname=1fK16ruxu6jD2w%3D%3D&amp;checkedRange=true&amp;queryType=cat\" target=\"_blank\"><img src=\"https://img.alicdn.com/imgextra/i4/1102809068/T2cSolXoFXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absMiddle\" /></a><a style=\"line-height: 1.5;\" href=\"http://milebjp.tmall.com/\" target=\"_blank\"><img src=\"https://img.alicdn.com/imgextra/i2/1102809068/T2Jx0yXcpOXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /></a></p>', '1226', '食品	饮品', '蜜乐', '0', '', '', '1', '0', null, '1462825130', '1463077527', '363', 'data/files/store_6285/goods_116/small_201605131025162312.jpg', '1', '1216', '1226', '0', '0', '135.00', '', '0', '', '0', '0', '0', '0', '0', '0.00', '1.10', 'weight');
INSERT INTO `ecm_goods` VALUES ('365', '6285', 'material', '蜜乐原 中蜂蜂蜜248g', '<p style=\"line-height: normal; color: #000000; font-size: medium; text-align: center;\"><img src=\"https://img.alicdn.com/imgextra/i3/1102809068/TB2VWFTnXXXXXXSXpXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /></p>\r\n<p style=\"line-height: 1.4; color: #404040;\"><span style=\"line-height: 27.0px; font-size: 18.0px;\">中华传统土蜂蜂蜜</span><span style=\"line-height: 1.5; font-size: 18.0px;\">又称土蜂蜜，就是中华蜂<span style=\"font-weight: bold;\">采集本土百花而成，产量稀缺，山区放养无污染</span>。</span></p>\r\n<p style=\"line-height: 1.4; color: #404040;\">&nbsp;<span style=\"font-size: 18.0px;\">我国的中华蜂在民间俗称为土蜂，只有这种蜂产的蜜才叫土蜂蜜。所采的蜜是山区高寒森林各种植物的野山花蜜，其蜜色泽深，结晶后为金黄色、口感清香而浓郁，富含有多种能被人体直接吸收的微量元素，由于酿蜜周期长、蜜源稀少被誉为<span style=\"font-weight: bold;\">&ldquo;蜜之珍品&rdquo;</span>。</span></p>\r\n<p style=\"line-height: normal; color: #000000; font-size: medium;\" align=\"center\"><img src=\"https://img.alicdn.com/imgextra/i3/1102809068/TB2Gq5hnXXXXXbYXXXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i4/1102809068/TB2k2hAnXXXXXc3XpXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><img style=\"float: none; margin: 0.0px; padding: 0.0px;\" src=\"https://img.alicdn.com/imgextra/i1/1102809068/T2ERC_XjRaXXXXXXXX_!!1102809068.jpg\" alt=\"\" /><a style=\"text-decoration: none; color: #3355aa; outline: none;\" href=\"http://milebjp.tmall.com/p/rd301457.htm?spm=a1z10.1.w5001-4723644935.2.Bn58k7&amp;scene=taobao_shop\" target=\"_blank\"><img src=\"https://img.alicdn.com/imgextra/i1/1102809068/TB2bQFqnXXXXXbFXXXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /></a><img style=\"float: none; margin: 0.0px; padding: 0.0px;\" src=\"https://img.alicdn.com/imgextra/i2/1102809068/T2Df_eXoxXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><img src=\"https://img.alicdn.com/imgextra/i2/1102809068/TB2Cg8BnXXXXXa0XXXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\"