INSERT INTO `ecm_goods` VALUES ('380', '6285', 'material', '蜜乐原酿蜂蜜 槐花蜂蜜2000g', '<p style=\"color: #000000; font-size: medium; line-height: normal; text-align: center;\"><img src=\"https://img.alicdn.com/imgextra/i4/1102809068/TB29jypnXXXXXbhXXXXXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal;\"><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">亲，你知道吗？槐花蜜是我国大宗蜜源量产的</span><strong style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">上等蜜品</strong><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">，也是历年</span><strong style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">大量出口、价位高的蜜品</strong><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">。</span></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal;\"><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">蜜乐的槐花蜜长期出口欧美日韩等国，在韩国，蜜乐的槐花蜜是制作</span><strong style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">蜂蜜柚子茶</strong><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">的主要原料。</span><span style=\"line-height: 1.5; color: #404040; font-size: 18.0px;\">（喜欢DIY的朋友可以也可以尝试一下哦）</span></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal;\"><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">槐花蜜具有清淡幽香的</span><strong style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">槐花香味，甘甜鲜洁，芳香适口</strong><span style=\"line-height: 25.0px; color: #404040; font-size: 18.0px;\">。</span></p>\r\n<p style=\"color: #000000; font-size: medium; line-height: normal; text-align: center;\"><img src=\"https://img.alicdn.com/imgextra/i4/1102809068/T2WBwkXiBaXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absMiddle\" /><img src=\"https://img.alicdn.com/imgextra/i1/1102809068/T2ERC_XjRaXXXXXXXX_!!1102809068.jpg\" alt=\"\" align=\"absmiddle\" /><img src=\"https://img.alicd